}
function getMedecinById ( id) {

    return new Promise( (resolve, reject) => {
        Axios.get(`${Config.BACKEND_URL}/medecin/${id}`,  {
            headers: {
                'Content-Type': 'application/json',
            }
        })
        .then((result) => {
            resolve(result);
        })
        .catch(err => {
