        });
    })
}

function recherche (specialite, ville) {

    return new Promise( (resolve, reject) => {
        Axios.get(`${Config.BACKEND_URL}/medecin/${specialite}/${ville}`,  {
            headers: {
                'Content-Type': 'application/json',
            }
        })
        .then((result) => {
            resolve(result);
        })
        .catch(err => {
            reject(err)
        });
